import React from 'react'
import {toLogout} from "../action";
import {connect} from "react-redux";


class profile extends React.Component{
    constructor(props) {
        super(props);
        this.login = this.props.user.login;

        this.state = {login: this.login,};

        this.handleSubmit = this.handleSubmit.bind(this);
    }

    handleSubmit(event) {
        event.preventDefault()


        this.props.logout(this.props.user.login).then(() => {
            this.props.history.push('/');
        })
    }
    render() {

        return (
            <div>

                <div className="w3-row gradient-bg"></div>
                <div className="w3-row gradient-bg">
                    <div className="w3-col l2 m1"><p></p></div>
                    <div className="w3-col l8 m10">
                        <div className="w3-light-gray" >
                            <p className="w3-xxlarge"> Я {this.props.user.login}</p>

                            <form onSubmit={this.handleSubmit}>

                                <button type="submit" value="Выйти" className="w3-button w3-black w3-hover-gray">Выйти</button>
                            </form>
                        </div>
                    </div>
                </div>
                <div className="w3-col l2 m1"><p></p></div>
                <div className="w3-row gradient-bg"></div>

            </div>
        )
    }
}

const mapStateToProps = (state) => {
    return {
        user: state.userReducer.user
    }
}

const mapDispatchToProps = (dispatch) => {
    return {
        logout: (login) => dispatch(toLogout(login)),
    }
};

export default connect(mapStateToProps, mapDispatchToProps)(profile);
